(window.webpackJsonp=window.webpackJsonp||[]).push([[537],{1107:function(n){n.exports={content:'<h2>GithubAPI-Authorization</h2>\n<p>\u4e00\u4e9b\u7279\u5b9a\u7684API\uff0c\u4f8b\u5982\u83b7\u53d6<code>user</code>\u7684public\u8d44\u6599\uff0c<code>repo</code>\u7684\u5185\u5bb9\u7b49\uff0c\u4e0d\u8ba4\u8bc1\u4e5f\u53ef\u4ee5\u83b7\u53d6\uff0c\n\u533a\u522b\u662f\uff0c\u4e0d\u8ba4\u8bc1\uff0c\u5927\u7ea6\u6bcf\u4e2a\u5c0f\u65f6\u53ea\u670960\u6b21\u8c03\u7528\u7684\u6b21\u6570\u9650\u5236\uff0c\u800c\u4f7f\u7528\u8ba4\u8bc1\u540e\uff0c\u5219\u5927\u7ea6\u67095000\u6b21\u7684\u8c03\u7528\u6b21\u6570\u3002</p>\n<p>\u8ba4\u8bc1\u67092\u65b9\u9762\uff0c</p>\n<ol>\n<li>\n<p>\u4f7f\u7528\u4f60\u81ea\u5df1\u7684\u540d\u4e49\u53bb\u505a\u4e00\u4e9b\u4e8b\u60c5</p>\n</li>\n<li>\n<p>\u4f7f\u7528\u4ed6\u4eba\u7684\u540d\u4e49\u53bb\u505a\u4e00\u4e9b\u4e8b\u60c5</p>\n</li>\n</ol>\n<h3>\u4ee5\u81ea\u5df1\u540d\u4e49</h3>\n<p>\u5148\u8bf4\u7b2c\u4e00\u79cd\uff0c\u7b2c\u4e00\u79cd\uff0c\u5f53\u7136\u53ef\u4ee5\u5728\u7f51\u9875\u4e0a\u64cd\u4f5c\uff0c\u8fd9\u662f\u6700\u76f4\u63a5\u7684\uff0c\u5982\u679c\u4f60\u9700\u8981\u7528\u63a7\u5236\u53f0\u8c03\u7528api\uff0c\n\u90a3\u4e48\u4f60\u9700\u8981\u5efa\u7acb\u4e00\u4e2a<code>personal token</code>\uff0c\u5728github\u7684setting\u91cc\u9762\uff0c\u91cc\u9762\u53ef\u4ee5\u52fe\u9009\u5bf9\u5e94\u7684<code>scope</code>\u4e5f\u5c31\u662f\u5141\u8bb8\u7684\u8303\u56f4\u3002</p>\n<p>\u4f8b\u5982\uff0c\u52fe\u9009<code>public_repo</code>\uff0c\u90a3\u4e48\u5c31\u53ef\u4ee5\u4f7f\u7528api\u53bb<code>create issue</code>\uff0c<code>create comment</code>\u7b49\u7b49</p>\n<p>\u5177\u4f53\u7684\u8c03\u7528\u65b9\u5f0f\u53ef\u4ee5\u653e\u5728header\u6216\u8005parameter</p>\n<ul>\n<li>header</li>\n</ul>\n<pre class="hljs"><code><span class="hljs-keyword">var</span> request = <span class="hljs-keyword">new</span> Request(<span class="hljs-string">\'https://api.github.com/user/{username}\'</span>,{\n    <span class="hljs-attr">headers</span>: <span class="hljs-keyword">new</span> Headers({\n      <span class="hljs-string">\'Authorization\'</span>: <span class="hljs-string">\'token xxxxxxxxxxxxxxxx\'</span>\n    })\n});\nfetch(request)\n.then(<span class="hljs-function"><span class="hljs-params">data</span>=&gt;</span>data.json()).then(<span class="hljs-function"><span class="hljs-params">obj</span>=&gt;</span>{\n  <span class="hljs-built_in">console</span>.log(obj)\n})\n</code></pre>\n<ul>\n<li>parameter</li>\n</ul>\n<pre class="hljs"><code>fetch(<span class="hljs-string">"https://api.github.com/user/{username}/?access_token=token xxxxxxxxxxxxxx"</span>)\n.then(<span class="hljs-function"><span class="hljs-params">data</span>=&gt;</span>data.json()).then(<span class="hljs-function"><span class="hljs-params">obj</span>=&gt;</span>{\n  <span class="hljs-built_in">console</span>.log(obj)\n})\n</code></pre>\n<h3>\u4ee5\u4ed6\u4eba\u540d\u4e49</h3>\n<p>\u53ef\u4ee5\u4f7f\u7528\u7b2c\u4e09\u65b9\u8ba4\u8bc1\uff0c\u4e5f\u5c31\u662fsetting\u91cc\u9762\u7684<code>oAuth token</code>\uff0c\u586b\u5199\u4f60\u7684\u5e94\u7528\u6216\u7f51\u7ad9\u7684url\uff0c\n<code>callback</code>\u7684\u610f\u601d\u662f\uff0c\u5f53\u5ba2\u6237\u8ba4\u8bc1\u5b8c\u6bd5\u4f1a\u91cd\u5b9a\u5411\u5230\u54ea\u91cc\u3002</p>\n<p><code>callback</code>\u4e00\u822c\u6307\u5411\u7684\u662f\u4f60\u81ea\u5df1\u7684\u670d\u52a1\u5668\uff0c\u5728\u90a3\u91cc\u4f60\u9700\u8981\u5c06\u91cd\u5b9a\u5411\u7684url\u4e2d\u7684\u53c2\u6570<code>code</code>\uff0c\u4f60\u7684<code>client_id</code>\uff0c<code>client_secret</code>\u5408\u5e76\u53bb\u83b7\u53d6\u7528\u6237\u7684<code>token</code>\u3002</p>\n<p>\u7136\u540e\u5c31\u53ef\u4ee5\u50cf\u4f7f\u7528\u8fd9\u4e2atoken(\u4f7f\u7528\u65b9\u6cd5\u89c1\u4e0a\u9762)\u53bb\u505a\u4e00\u4e9b\u4e8b\u60c5\u4e86\u3002</p>\n<p>\u6ce8\u610f\uff1a</p>\n<ol>\n<li><code>client_secret</code>\u4e0d\u53ef\u4ee5\u900f\u6f0f\u7ed9\u5176\u4ed6\u4eba\uff0c\u5426\u5219\u522b\u4eba\u53ef\u4ee5\u501f\u4f60\u7684\u540d\u4e49\u53bb\u83b7\u53d6\u5176\u4ed6\u4eba\u7684\u6388\u6743\u3002</li>\n<li>\u5173\u4e8e\u5408\u5e76\u6570\u636e\u83b7\u53d6token\u7684\u8fc7\u7a0b\uff0c\u8981\u5728\u540e\u7aef\u8fdb\u884c\uff0c\u524d\u7aef\u4e5f\u53ef\u4ee5\u8fdb\u884c\uff0c\u4f46\u6ca1\u6709\u5b89\u5168\u6027\u53ef\u8a00\u3002</li>\n</ol>\n'}}}]);
